Julia Ann, Ann Marie Rios, Roxanne Hall, Isobel Wren, Zoe Voss, Raylene, Michelle Lay, Nikki Cruz.


Legends &amp; Starlets 4 - Sweetheart Video. Legends And Starlets returns with four truly inspired scenes in Volume 4 of the hit series. Raylene is a former teen star fantasizing about recapturing her fame, but lithe young roommate Zoe Voss gives the curvy brunette a tongue lashing - and a reality check of hot lesbian sex. Meanwhile, Roxanne Hall is fed up with snooty step-daughter-to-be Isobel Wren. When the young college student won't warm up to the athletic older blonde, extreme measures may be in order to insure woman-to-girl &quot;bonding&quot;. Young Latina Ann Marie Rios is a careless assistant to strict, older blonde Julia Ann. But is Ann Marie purposefully making mistakes to be &quot;punished&quot; by the tall, busty goddess? Finally, older brunette Michelle Lay lets cute Nikki Cruz preach her religious beliefs just so she can get the young hottie inside her house. But when the young pious teen speaks out against lesbianism, toned, tanned Michelle decides to do a little physical &quot;preaching&quot; of her own.
